// ==UserScript==
// @name         OP Dino Hax
// @namespace    https://tampermonkey.net/
// @version      1.0
// @description  chrome://dino hax.\nh = Toggle hax\ni = Toggle invincibility (hax must be on!!)\ns = Toggle speed hax (hax must be on!!)\np = Change speed for speed hax(hax must be on!! and MUST use speed hax before doing it!!!!!!!!)\nNote: Dark Mode IS ON!!!!\n\nSet Score hax comming soon!
// @author       Winslow Parker
// @match        chrome://dino
// @icon         data:image/gif;base64,
// @grant        none
// ==/UserScript==

(function() {
    'use strict';

    const readline = require('readline');
    const rl = readline.createInterface(
        process.stdin,
        process.stdout
    );
    const sleep = (ms) => {
        return new Promise((r) => {
            return setTimeout(r, ms)
        })
    };

    const html = document.querySelector(".offline");
    const body = document.querySelector(".offline body");
    const HTMLStyle = html.style;
    const BodyStyle = body.style;
    const HTMLTransition = HTMLStyle.transition;
    const BodyTransition = BodyStyle.transition;
    const style = "--background-color: var(--google-gray-900); --error-code-color: var(--google-gray-500); --heading-color: var(--google-gray-500); --link-color: var(--google-blue-300); --primary-button-fill-color-active: rgb(129, 162, 208); --primary-button-fill-color: var(--google-blue-300); --primary-button-text-color: var(--google-gray-900); --quiet-background-color: var(--background-color); --secondary-button-border-color: var(--google-gray-700); --secondary-button-fill-color: var(--google-gray-900); --secondary-button-hover-fill-color: rgb(48, 51, 57); --secondary-button-text-color: var(--google-blue-300); --small-link-color: var(--google-blue-300); --text-color: var(--google-gray-500);";
    const GameOver = Runner.instance_.gameOver();
    const Speed = Runner.instance_.currentSpeed();
    const Sprite = Runner.imageSprite.src;

    let key = 0;
    let enabled = false;
    let DM = false;
    let speed = 0;
    let speedHax = false;
    let speedHaxPrev = false;

    function toggleInvincibility() {
        Runner.instance_.gameOver = function (){} ? Runner.instance_.gameOver() == GameOver() : Runner.instance_.gameOver = GameOver();
    }

    function toggleSpeedHax() {
        if (speedHax) {
            if (!speedHaxPrev) {
                rl.question("Enter speed (will remain the same):\n(1 - 1000000)", (speedrl) => {
                    if (speedrl <= 1000000) {
                        Runner.instance_.setSpeed(speedrl);
                        speed = speedrl;
                    } else {
                        toggleSpeedHax();
                    }
                });

                speedHaxPrev = true;
            } else {
                Runner.instance_.setSpeed(speed);
            }
        } else {
            Runner.instance_.setSpeed(Speed);
        }

        speedHax = !speedHax;
    }

    function changeSpeed() {
        rl.question("Enter new speed (will remain the same):\n(1-1000000)", (speedrl) => {
            Runner.instance_.setSpeed(speedrl);
            speed = speedrl;
        });
    }
    function changeSprite() {
        rl.question("Enter image URL (type \"default\" for original sprite image):", (imgurl) => {
            if (imgurl === "default") {
                Runner.imageSprite.src = Sprite;
            } else if (imgurl.typeOf(String)) {
                Runner.imageSprite.src = imgurl;
            } else {
                changeSprite();
            }
        });
    }

    function setScore() {
        rl.question("Enter Score:\n(1 - 1000000000)", (score) => {
            if (score <= 1000000000) {
                dinogamescore = score;
            } else {
                return;
            }
        });
    }

    function hax(e) {
        key = e.keyCode;

        sleep(1000);
        if (key == 72) {
            enabled = !enabled;
        } else if (enabled) {
            switch (key) {
                case 73:
                    toggleInvincibility();
                    break;
                case 83:
                    toggleSpeedHax();
                    break;
                case 80:
                    if (speedHaxPrev) {
                        changeSpeed();
                        break;
                    } else {
                        break;
                    }
                case 82:
                    changeSprite();
                    break;
                // case 67:
                //     setScore();
                //     break;
            }
        }
    }

    document.addEventListener("click", hax());

    while (true) {
        html.style.transition = "unset";
        body.style.transition = "unset";

        if (html.style != style) {
            html.style = style;
        }
        if (body.style != style) {
            body.style = style
        }
    }
})();
